import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS via search input
    const xssPayload = `<img src=x onerror=alert('xss')>`;
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after filling XSS payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_filled.png'));

    // Try to trigger search using the search button (by class)
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    // There may be multiple .search-btn, click the first visible one
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }

    // Wait for possible search results or DOM update
    await page.waitForTimeout(1000);

    // Take screenshot after triggering search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Try to extract if the payload is reflected in the DOM (basic check)
    let xssReflected = false;
    // Check if any img with src=x exists in the DOM after search
    const imgHandles = await page.$$('img[src="x"]');
    if (imgHandles.length > 0) {
      xssReflected = true;
    } else {
      // Also check if the raw payload is present in the HTML
      const htmlContent = await page.content();
      if (htmlContent.includes(xssPayload)) {
        xssReflected = true;
      }
    }

    return {
      success: true,
      action: "Attempted XSS via search input and checked for payload reflection",
      extractedData: {
        xssPayload,
        xssReflected
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
